    "# Combine all dataframes into a single dataframe for analysis\n",
    "combined_df = pd.concat([dataframes[f]['Value'] for f in predictors if f in dataframes], axis=1)\n",
    "combined_df.columns = predictors\n",
    "\n",
    "# Calculate summary statistics for the selected predictors\n",
    "summary_statistics = combined_df.describe()\n",
    "summary_statistics = summary_statistics.transpose()\n",
    "\n",
    "# Display the summary statistics table\n",
    "print(summary_statistics)\n",
    "\n",
    "# Fill any NaN values\n",
    "combined_df.fillna(method='ffill', inplace=True)\n",
    "\n",
    "# Normalize the dataset\n",
    "scaler = MinMaxScaler()\n",
    "scaled_data = scaler.fit_transform(combined_df)\n",
    "scaled_df = pd.DataFrame(scaled_data, columns=predictors)\n",
    "\n",
    "# Split the data\n",
    "train_df, test_df = train_test_split(scaled_df, test_size=0.3, random_state=42)\n",
    "X_train = train_df.drop(['PM2.5', 'PM10'], axis=1)\n",
    "y_train = train_df[['PM2.5', 'PM10']]\n",
    "X_test = test_df.drop(['PM2.5', 'PM10'], axis=1)\n",
    "y_test = test_df[['PM2.5', 'PM10']]\n"
