    "\n",
    "    def on_epoch_begin(self, epoch, logs=None):\n",
    "        self.epoch_start_time = time.time()\n",
    "\n",
    "    def on_epoch_end(self, epoch, logs=None):\n",
    "        self.epochs.append(epoch)\n",
    "        for key, value in logs.items():\n",
    "            if key not in self.history:\n",
    "                self.history[key] = []\n",
    "            self.history[key].append(value)\n",
    "        # Record time taken for each epoch\n",
    "        self.epoch_times.append(time.time() - self.epoch_start_time)\n",
    "\n",
    "    def on_train_end(self, logs=None):\n",
    "        # Calculate statistics at the end of training\n",
    "        self.total_time = sum(self.epoch_times)\n",
    "        self.mean_time = np.mean(self.epoch_times)\n",
    "        self.std_time = np.std(self.epoch_times)\n",
    "        self.max_time = np.max(self.epoch_times)\n",
    "        self.min_time = np.min(self.epoch_times)\n",
    "\n",
    "# Define a function to create the LSTM model\n",
    "def create_lstm_model(neuron_count, input_shape):\n",
    "    model = Sequential([\n",
    "        LSTM(neuron_count, return_sequences=True, input_shape=input_shape),\n",
    "        Dropout(0.2),\n",
    "        LSTM(neuron_count, return_sequences=True),\n",
    "        Dropout(0.2),\n",
    "        LSTM(neuron_count),\n",
    "        Dropout(0.2),\n",
    "        Dense(1)\n",
    "    ])\n",
    "    model.compile(optimizer=tf.keras.optimizers.Adam(learning_rate=0.01), loss='mean_squared_error')\n",
