    "# LSTM Model Prediction\n",
    "# Reshape the input for LSTM if it's not already reshaped:\n",
    "X_test_lstm = X_test.values.reshape((X_test.shape[0], 1, X_test.shape[1]))\n",
    "lstm_predictions = model.predict(X_test_lstm).flatten()  # Ensure lstm model is trained and ready\n",
    "\n",
    "# Calculate performance metrics for both models\n",
    "mlp_rmse = np.sqrt(mean_squared_error(y_test['PM2.5'], mlp_predictions))\n",
    "mlp_mae = mean_absolute_error(y_test['PM2.5'], mlp_predictions)\n",
    "mlp_r2 = r2_score(y_test['PM2.5'], mlp_predictions)\n",
    "\n",
    "lstm_rmse = np.sqrt(mean_squared_error(y_test['PM2.5'], lstm_predictions))\n",
    "lstm_mae = mean_absolute_error(y_test['PM2.5'], lstm_predictions)\n",
    "lstm_r2 = r2_score(y_test['PM2.5'], lstm_predictions)\n",
    "\n",
    "# Plot Actual vs Predicted Values for MLP\n",
